import Avatar from 'react-avatar';
const Client = ({ Username }) => {
    return (
        <div className='user'>
            <Avatar name={Username} size={50} round="20px" />
            <span className='username'>
                {Username}
            </span>
        </div>
    )
}

export default Client;
